(696, 0, 111111, 18, 'K', 'dbdata', '<p>Vielen Dank für die Eingabe Ihrer Daten. Wir berechnen nun die Ergebnisse.</p>\n\n<p>Bitte klicken Sie auf "weiter".</p>\n', '', '<script type="text/javascript">\n$(document).ready(function()\n{\n  //always hide answer list\n  $(''#question{QID} .answer'').hide();\n\n  //ZIP entered at previous question\n// uncomment var zip, if you want to use dynamic use of the table kwis_zipfactor\n  //var zip = {zip.NAOK};\n  var zip = 00000;\n  \n  //hard coded table name\n  var tablename = "kwis_zipfactor";\n  \n  //take column names from hidden question\n  var colnamesurl = encodeURIComponent("{columnnames.question}");\n  var colnames = "{columnnames.question}";\n  \n  //store column names as array\n  var colarray = colnames.split(",");\n  \n  var factors = [];\n  /*Ajax query for DB */\n  $.ajax\n    ({ \n        url: ''/getfactors.php'',\n        data: { columnnames: colnamesurl, tablename: tablename, zip: zip },\n        type: ''get'',\n        success: function(result)\n        {\n            if(result.length > 0)\n            {\n              //get JSON data from PHP\n               factors = JSON.parse(result);\n                //loop through all elements and add queried factor at question field\n              for (index = 0; index < colarray.length; ++index) {\n                console.log(colarray[index]);\n                console.log(factors[index]);\n                \n                var sqcode = colarray[index].replace("_","");\n                \n                //add value to LS field\n                $(''#answer{SID}X{GID}X{QID}''+sqcode).val(factors[index]);\n                \n                }\n            }\n        }\n  });\n  \n\n});\n</script>', 'N', 'N', 0, 'fr', 0, 0, '1', ''),
