(111111, 'fr', 'Clim'' Ability Check', 'Selbstbewertung von Klimarisiken für Unternehmen', '<div style="padding-top:15px;background-color:#fff;width:800px;margin:10px auto"><a href="http://www.klimafolgendialog.de/" target="_blank"><img alt="Logo Klimafolgendialog" class="logo" id="logo1" src="/upload/templates/default_minke/files/logo_klimafolgendialog.png"  style="padding-left:15px;padding-right:30px;"/></a><a href="http://www.clim-ability.eu/" target="_blank"><img alt="Logo Clim'' Ability" class="logo" id="logo2" src="/upload/templates/default_minke/files/logo_climability.jpg" /></a></div>\r\n \r\n<div style="text-align:center;width:100%"><p>Die bei der Benutzung dieses Online-Bewertungsinstruments anfallenden Daten werden anonym gespeichert und nur zu wissenschaftlichen Zwecken verwendet.</p>\r\n<button accesskey="n" class="submit button btn btn-lg  btn-primary" id="movenextbtn" name="movenext" type="submit" value="movenext">Check jetzt starten</button></div>\r\n <p></p>\r\n\r\n<div id="logos"><a href="http://www.interreg-rhin-sup.eu/" target="_blank"><img alt="Logo FEDER" class="logo" id="logo1" src="/upload/templates/default_minke/files/logo_interreg.jpg" /></a></div>\r\n<script>\r\n $(document).ready(function()\r\n {\r\n    $(''.save-all #movenextbtn'').hide();\r\n });\r\n</script>', '<h2>Auswertung</h2><div id="printdiv"><a class="summaryprintlink" href="javascript:window.print()">Zusammenfassung drucken</a></div>\r\n\r\n<p>{if(totalExpSens.NAOK >= 70, "<strong>Votre établissement fait partie des entreprises qui sont déjà fortement impactées par les conséquences du changement climatique.</strong><br><br><strong>Stratégies et mesures envisageables pour minimiser les risques:</strong><ul><li>Profitez des outils d’évaluation de risques utilisés dans votre entreprise pour définir les risques liés au changement climatique (par exemple les systèmes de gestion de risques, la gestion stratégique).</li><li>Assurez un ombrage suffisant ; installez une protection solaire sur de grands espaces vitrés ; considérez une toiture végétale qui contribue à maintenir une température agréable à l’intérieur du bâtiment.</li><li>Réduisez les sources de chaleur superflues dans le bâtiment (éclairage, machines). Vérifiez l’étendu de votre couverture d’assurance, surtout par rapport à l’assurance contre des dangers naturels.</li><li>Assurez un entretien régulier de l’infrastructure existante et des dispositifs de protection.</li><li>Vérifiez si les dispositifs de protection présentent des dimensions suffisantes (par exemple parafoudre et paratonnerre, clapet de non-retour, digue ou portes de protection contre les crues, estrades pour les appareils et équipements sensibles).</li><li>Lorsque vous entreprenez des nouvelles constructions, évitez le bétonnage du sol ; créez, le cas échéant, de nouvelles surfaces perméables.</li><li>Vérifiez si l’installation d’une alimentation (en électricité) de secours est indiquée et pertinente. </li></ul>", if(totalExpSens.NAOK > 19 AND totalExpSens.NAOK < 70, "<strong>Votre établissement fait partie des entreprises qui sont déjà impactées par les conséquences du changement climatique.</strong><br><br><strong>Des stratégies et mesures envisageables pour minimiser les risques potentiels:</strong><ul><li>Profitez des outils d’évaluation de risques utilisés dans votre entreprise pour définir les risques liés au changement climatique (par exemple les systèmes de gestion de risques, la gestion stratégique).</li><li>Assurez un ombrage suffisant ; installez une protection solaire sur de grands espaces vitrés ; considérez une toiture végétale qui contribue à maintenir une température agréable à l’intérieur du bâtiment.</li><li>Réduisez les sources de chaleur superflues dans le bâtiment (éclairage, machines). Vérifiez l’étendu de votre couverture d’assurance, surtout par rapport à l’assurance contre des dangers naturels.</li>- Assurez un entretien régulier de l’infrastructure existante et des dispositifs de protection.</li><li>Vérifiez si les dispositifs de protection présentent des dimensions suffisantes (par exemple parafoudre et paratonnerre, clapet de non-retour, digue ou portes de protection contre les crues, estrades pour les appareils et équipements sensibles).</li><li> Lorsque vous entreprenez des nouvelles constructions, évitez le bétonnage du sol ; créez, le cas échéant, de nouvelles surfaces perméables.</li><li>Vérifiez si l’installation d’une alimentation (en électricité) de secours est indiquée et pertinente.</li></ul>","<strong>Votre entreprise n’est pas ou n’est que faiblement impactée par les conséquences directes du changement climatique.</strong><br><strong>Des stratégies et mesures envisageables pour continuer à minimiser les risques potentiels:</strong><ul><li>Profitez des outils d’évaluation de risques utilisés dans votre entreprise pour définir les risques liés au changement climatique (par exemple les systèmes de gestion de risques, la gestion stratégique).</li><li>Assurez un entretien régulier de l’infrastructure existante et des dispositifs de protection.</li><li>Lorsque vous entreprenez des nouvelles constructions, évitez le bétonnage du sol ; créez, le cas échéant, de nouvelles surfaces perméables.</li></ul>"))}</p>\r\n\r\n<p>{if(sumAnp.NAOK >=17, "En outre, votre entreprise dispose d’une grande capacité d’adaptation. Vous pouvez donc maîtriser des défis futurs liés au changement climatiques. Indépendamment de l’impact actuel du changement climatique sur votre établissement, la capacité d’adaptation est un bon indicateur pour le positionnement de votre entreprise par rapport aux défis posés par le changement climatique.<br>Cet outil d’évaluation vous fournit des indices supplémentaires sur l’impact du changement climatique sur votre entreprise. Ces informations vous permettent d’établir les bases pour calculer d’autres améliorations concernant la capacité d’adaptation de votre entreprise.</p><p><strong>Des propositions pour améliorer la capacité d’adaptation de votre entreprise:</strong></p><ul><li>Sollicitez un échange d’expériences avec d’autres entreprises qui sont touchées davantage par l’impact du changement climatique.</li><li>Encouragez la communication au sein de votre entreprise concernant les conséquences (potentielles) du changement climatique sur votre secteur en général et votre entreprise en particulier, et profitez du savoir-faire de vos collaborateurs.</li><li>Développez des plans d’urgence qui vous permettent d’alléger les conséquences particulièrement graves pour votre entreprise (p. e. les inondations etc.).</li><li>Implémentez un volet d’adaptation au changement climatique dans votre plan de gestion d’entreprise (gestion des risques, gestion stratégique).</li></ul>", if(sumAnp.NAOK > 8 AND sumAnp.NAOK < 17 , "En outre, votre entreprise dispose d’une certaine capacité d’adaptation. Ainsi, vous pouvez maîtriser des défis futurs liés au changement climatiques. Indépendamment de l’impact actuel du changement climatique sur votre établissement, la capacité d’adaptation est un bon indicateur pour le positionnement de votre entreprise par rapport aux défis posés par le changement climatique.</p><p>Cet outil d’évaluation vous fournit des indices supplémentaires sur l’impact du changement climatique sur votre entreprise. Ces informations vous permettent d’établir les bases pour calculer d’autres améliorations concernant la capacité d’adaptation de votre entreprise.</p><p><strong>Des propositions pour améliorer la capacité d’adaptation de votre entreprise:</strong></p><ul><li>Sollicitez un échange d’expériences avec d’autres entreprises qui sont touchées davantage par l’impact du changement climatique.</li><li>Encouragez la communication au sein de votre entreprise concernant les conséquences (potentielles) du changement climatique sur votre secteur en général et votre entreprise en particulier, et profitez du savoir-faire de vos collaborateurs.</li><li>Développez des plans d’urgence qui vous permettent d’alléger les conséquences particulièrement graves pour votre entreprise (p. e. les inondations etc.).</li><li>Implémentez un volet d’adaptation au changement climatique dans votre plan de gestion d’entreprise (gestion des risques, gestion stratégique). </li></ul>",if(sumAnp.NAOK < 9,"En outre, votre entreprise dispose d’une capacité d’adaptation relativement faible. Ainsi, vous pouvez maîtriser des défis futurs liés au changement climatiques. Indépendamment de l’impact actuel du changement climatique sur votre établissement, la capacité d’adaptation est un bon indicateur pour le positionnement de votre entreprise par rapport aux défis posés par le changement climatique.</p><p>Cet outil d’évaluation vous fournit des indices supplémentaires sur l’impact du changement climatique sur votre entreprise. Ces informations vous permettent d’établir les bases pour calculer d’autres améliorations concernant la capacité d’adaptation de votre entreprise.</p><p><strong>Des propositions pour améliorer la capacité d’adaptation de votre entreprise:</strong></p><ul><li>Sollicitez un échange d’expériences avec d’autres entreprises qui sont touchées davantage par l’impact du changement climatique.</li><li>Encouragez la communication au sein de votre entreprise concernant les conséquences (potentielles) du changement climatique sur votre secteur en général et votre entreprise en particulier, et profitez du savoir-faire de vos collaborateurs.</li><li>Développez des plans d’urgence qui vous permettent d’alléger les conséquences particulièrement graves pour votre entreprise (p. e. les inondations etc.).</li><li>Implémentez un volet d’adaptation au changement climatique dans votre plan de gestion d’entreprise (gestion des risques, gestion stratégique).</li></ul>","")))}</p>\r\n\r\n{if(E5_SQ001.NAOK=="Y" OR E5_SQ002.NAOK=="Y" OR E5_SQ003.NAOK=="Y" OR E5_SQ004.NAOK=="Y" OR E5_SQ005.NAOK=="Y" OR E5_SQ006.NAOK=="Y" OR E5_SQ007.NAOK=="Y" OR E5_SQ008.NAOK=="Y" OR E5_SQ009.NAOK=="Y" OR E5_SQ010.NAO