vous permet de réagir très rapidement en cas de difficultés d’approvisionnement ou des pertes de production et de vous adapter à la nouvelle situation.", if(K3.NAOK=="A3", "Compte tenu de votre faible flexibilité en approvisionnement, vous pouvez souffrir indirectement des conséquences négatives du changement climatique par le biais de vos fournisseurs. N’oubliez pas d’inclure les fournisseurs les plus importants ainsi que la logistique concernée dans votre analyse des risques. Identifiez par exemple les produits (primaires) critiques provenant des fournisseurs et évaluez s’il est nécessaire d’opter pour un approvisionnement par plusieurs fournisseurs.</u>",""))}</p>\r\n\r\n<p>{if(E14.NAOK=="A1", "Par le passé, il y a eu plusieurs perturbations opérationnelles liées à des phénomènes météorologiques extrêmes.", if(E14.NAOK=="A2", "In der Vergangenheit ist es bereits zu einer Störung des betrieblichen Ablaufs gekommen, die auf Extremwetterereignisse zurückzuführen war.",""))}</p>\r\n\r\n<p>{if(E20.NAOK=="A1", "La production de votre entreprise dépend très fortement d’un système logistique fiable – autant chez vous que chez vos fournisseurs. La complexité croissante de votre chaîne de logistique augmente sa fragilité par rapport aux perturbations liées à des évènements extraordinaires (par exemples des phénomènes météorologiques extrêmes). Tenez-en compte lors de l’élaboration de votre gestion de risques.", if(E20.NAOK=="A2", "La production de votre entreprise dépend très fortement d’un système logistique fiable – autant chez vous que chez vos fournisseurs. La complexité croissante de votre chaîne de logistique augmente sa fragilité par rapport aux perturbations liées à des évènements extraordinaires (par exemples des phénomènes météorologiques extrêmes). Tenez-en compte lors de l’élaboration de votre gestion de risques.",""))}</p>\r\n\r\n<p>{if(K4.NAOK=="A1", "Vous avez déjà mis les conséquences du changement climatique à l’ordre du jour. Vous avez reconnu l’importance du changement climatique et de son impact sur votre entreprise et votre plan opérationnel.", if(K4.NAOK=="A2", "Vous avez déjà mis les conséquences du changement climatique à l’ordre du jour. Vous avez reconnu l’importance du changement climatique et de son impact sur votre entreprise et votre plan opérationnel.", if(K4.NAOK=="A3","Vous avez déjà discuté de quelques conséquences particulières liées au changement climatique qui pourraient impacter votre entreprise. <br>Vous devriez tenir compte des évolutions futures pouvant affecter votre entreprise à court ou à moyen terme lors de la prise de décisions (investissements, développement de produits et de services, élaboration de la stratégie pour l’entreprise etc.). C’est la seule façon de reconnaître de futures opportunités sur le marché et d’atténuer des risques potentiels pour l‘entreprise.", if(K4.NAOK=="A4", "Jusqu’à présent, vous n’avez jamais abordé le sujet des conséquences du changement climatique au sein de votre entreprise.<br />Néanmoins, vous devriez questionner de façon ciblée votre opinion que les conséquences du changement climatique n’ont aucune importance pour votre entreprise. Vous pouvez déjà faire un premier pas en utilisant notre outil d‘autoévaluation.",""))))}</p>\r\n\r\n<p>{if(K5.NAOK=="A1", join("Vous n’avez pas seulement discuté des conséquences du changement climatique dans votre entreprise, mais vous avez déjà développé des mesures concrètes pour vous adapter au changement climatique:<br />",K5_comment.NAOK),if(K5.NAOK=="A2", "Jusqu’à présent, vous n’avez pas développé de plans de mesures concrètes ou des projets de réalisation / de mise en œuvre dans le contexte de la lutte contre les impacts du changement climatique.",""))}</p>\r\n{if(E24.NAOK=="A2","<p>Les exigences envers vos produits / vos services ont déjà été modifiées suite aux conséquences liées au changement climatique.</p>","")} {if(K7.NAOK=="A1","<p>Jusqu’à présent, vous pouviez bien adapter votre offre de service à ses besoins modifiés.</p>",if(K7.NAOK=="A2", "<p>Jusqu’à présent, vous pouviez bien adapter votre offre de service à ses besoins modifiés.</p>",if(K7.NAOK=="A3", "<p>Malheureusement, vous n’étiez pas en mesure d’adapter votre gamme de service aux besoins modifié comme souhaité. Nous vous prions de tenir compte du fait que la capacité d’adaptation aux conséquences du changement climatique pourra compromettre la viabilité future de votre entreprise. Relevez les défis et informez-vous sur les sujets comme l’adaptation aux conséquences du changement climatique dans l’entreprise, l’analyse de vulnérabilité et la gestion de risques dans le contexte des impacts liés au changement climatique.</p>","")))}\r\n\r\n<h2>Information sur les projets et ces financements:</h2><p>L’outil d’évaluation en ligne Clim’Ability Check a été développé dans le cadre des projets Clim’Ability INTERREG V Rhin Supérieur et KlimaFolgenDialog.<br />\r\nClim’Ability est un projet de recherche soutenu par le programme INTERREG V Rhin Supérieur. L’INTERREG V est la cinquième génération du programme européen INTERREG. Ce dernier soutient la recherche dans la région du Région supérieur, située au carrefour entre la France, l’Allemagne et la Suisse. <br />\r\nVous pouvez trouver des informations supplémentaires sur notre sites web: <br /> <a href="http://www.clim-ability.eu" target="_blank">www.clim-ability.eu</a></p><p>L’outil d’évaluation en ligne KlimaFolgenCheck a été développé dans le cadre du projet « KlimaFolgenDialog - Kommunale Kompetenznetzwerke zur Anpassung der Wirtschaft an den Klimawandel » (Dialogue-Conséquences-Climatiques « travaille » au développement/promotion de réseaux de compétences communales pour la promotion de l’adaptation des entreprises au changement climatique).<br />Vous pouvez trouver des informations supplémentaires sur notre site web sous  <a href="https://www.klimafolgendialog.de/" target="_blank">www.klimafolgendialog.de</a></p><p>Le projet est subventionné par le Ministère fédéral allemand de l’environnement, de la protection de la nature et de la sûreté des réacteurs (BMU), suite à une décision du Deutscher Bundestag (n° de référence : 03DAS060). Le financement fait partie du programme de subventions « Mesures de promotion de l’adaptation aux impacts du changement climatique » et figure dans le cadre de la stratégie allemande d’adaptation au changement climatique (DAS).<br />Pour des renseignements supplémentaires, veuillez consulter le lien suivant : http://bmub.bund.de/themen/klima-energie/klimaschutz/anpassung-an-den-klimawandel/" ainsi que http://www.ptj.de/folgen-klimawandel".<br />Si vous avez des questions ou voulez nous communiquer vos commentaires, vous pouvez nous joindre sous <a href="mailto:klimafolgendialog@ita-kl.de">klimafolgendialog@ita-kl.de</a>.</p>\r\n', '', '', 'Einladung zu einer Umfrage', 'Hallo {FIRSTNAME},<br />\n<br />\nHiermit möchten wir Sie zu einer Umfrage einladen.<br />\n<br />\nDer Titel der Umfrage ist <br />\n''{SURVEYNAME}''<br />\n<br />\n''{SURVEYDESCRIPTION}''<br />\n<br />\nUm an dieser Umfrage teilzunehmen, klicken Sie bitte auf den unten stehenden Link.<br />\n<br />\nMit freundlichen Grüßen,<br />\n<br />\n{ADMINNAME} ({ADMINEMAIL})<br />\n<br />\n----------------------------------------------<br />\nKlicken Sie hier um die Umfrage zu starten:<br />\n{SURVEYURL}<br />\n<br />\nWenn Sie an diese Umfrage nicht teilnehmen und keine weiteren Erinnerungen erhalten möchten, klicken Sie bitte auf den folgenden Link:<br />\n{OPTOUTURL}<br />\n<br />\nWenn Sie geblockt sind, jedoch wieder teilnehmen und weitere Einladungen erhalten möchten, klicken Sie bitte auf den folgenden Link:<br />\n{OPTINURL}', 'Erinnerung an die Teilnahme an einer Umfrage', 'Hallo {FIRSTNAME},<br />\n<br />\nVor kurzem haben wir Sie zu einer Umfrage eingeladen.<br />\n<br />\nZu unserem Bedauern haben wir bemerkt, dass Sie die Umfrage noch nicht ausgefüllt haben. Wir möchten Ihnen mitteilen, dass die Umfrage noch aktiv ist und würden uns freuen, wenn Sie teilnehmen könnten.<br />\n<br />\nDer Titel der Umfrage ist <br />\n''{SURVEYNAME}''<br />\n<br />\n''{SURVEYDESCRIPTION}''<br />\n<br />\nUm an dieser Umfrage teilzunehmen, klicken Sie bitte auf den unten stehenden Link.<br />\n<br />\n Mit freundlichen Grüßen,<br />\n<br />\n{ADMINNAME} ({ADMINEMAIL})<br />\n<br />\n----------------------------------------------<br />\nKlicken Sie hier um die Umfrage zu starten:<br />\n{SURVEYURL}<br />\n<br />\nWenn Sie an diese Umfrage nicht teilnehmen und keine weiteren Erinnerungen erhalten möchten, klicken Sie bitte auf den folgenden Link:<br />\n{OPTOUTURL}', 'Registrierungsbestätigung für Teilnahmeumfrage', 'Hallo {FIRSTNAME},<br />\n<br />\nSie (oder jemand, der Ihre E-Mail benutzt hat) haben sich für eine Umfrage mit dem Titel {SURVEYNAME} angemeldet.<br />\n<br />\nUm an dieser Umfrage teilzunehmen, klicken Sie bitte auf den folgenden Link.<br />\n<br />\n{SURVEYURL}<br />\n<br />\nWenn Sie irgendwelche Fragen zu dieser Umfrage haben oder wenn Sie sich _nicht_ für diese Umfrage angemeldet haben und sie glauben, dass Ihnen diese E-Mail irrtümlicherweise zugeschickt worden ist, kontaktieren Sie bitte {ADMINNAME} unter {ADMINEMAIL}.', 'Bestätigung für die Teilnahme an unserer Umfrage', 'Hallo {FIRSTNAME},<br />\n<br />\nVielen Dank für die Teilnahme an der Umfrage mit dem Titel {SURVEYNAME}. Ihre Antworten wurden bei uns gespeichert.<br />\n<br />\nWenn Sie irgendwelche Fragen zu dieser E-Mail haben, kontaktieren Sie bitte {ADMINNAME} unter {ADMINEMAIL}.<br />\n<br />\nMit freundlichen Grüßen,<br />\n<br />\n{ADMINNAME}', 1, NULL, 'Antwortabsendung für Umfrage {SURVEYNAME}', 'Hallo,<br />\n<br />\nEine neue Antwort wurde für die Umfrage ''{SURVEYNAME}'' abgegeben.<br />\n<br />\nKlicken Sie auf den folgenden Link um die Umfrage neu zu laden:<br />\n{RELOADURL}<br />\n<br />\nKlicken Sie auf den folgenden Link um den Antwortdatensatz anzusehen:<br />\n{VIEWRESPONSEURL}<br />\n<br />\nKlicken Sie auf den folgenden Link um den Antwortdatensatz zu bearbeiten:<br />\n{EDITRESPONSEURL}<br />\n<br />\nUm die Statistik zu sehen, klicken Sie hier:<br />\n{STATISTICSURL}', 'Antwortabsendung für Umfrage {SURVEYNAME} mit Ergebnissen', 'Hallo,<br />\n<br />\nEine neue Antwort wurde für die Umfrage ''{SURVEYNAME}'' abgegeben.<br />\n<br />\nKlicken Sie auf den folgenden Link um die Umfrage neu zu laden:<br />\n{RELOADURL}<br />\n<br />\nKlicken Sie auf den folgenden Link um den Antwortdatensatz anzusehen:<br />\n{VIEWRESPONSEURL}<br />\n<br />\nKlicken Sie auf den folgenden Link um den Antwortdatensatz zu bearbeiten:<br />\n{EDITRESPONSEURL}<br />\n<br />\nUm die Statistik zu sehen, klicken Sie hier:<br />\n{STATISTICSURL}<br />\n<br />\n<br />\nDie folgenden Antworten wurden vom Teilnehmer gegeben:<br />\n{ANSWERTABLE}', 0, NULL);
